var EllipseCurveModule = require('./EllipseCurve');
var ArcCurve;
ArcCurve = function (aX, aY, aRadius, aStartAngle, aEndAngle, aClockwise) {
	EllipseCurveModule.EllipseCurve.call(this, aX, aY, aRadius, aRadius, aStartAngle, aEndAngle, aClockwise);
};
ArcCurve.prototype = Object.create(EllipseCurveModule.EllipseCurve.prototype);
ArcCurve.prototype.constructor = ArcCurve;
ArcCurve.prototype.isArcCurve = true;
exports.ArcCurve = ArcCurve;